export const CART_ACTIONS = {
  addDish: 'cart/addDish',
  removeDish: 'cart/removeDish',
  clearCart: 'cart/clearCart'
}

export const addDish = (dishName) => ({
  type: CART_ACTIONS.addDish,
  payload: dishName,
});

export const removeDish = (dishName) => ({
  type: CART_ACTIONS.removeDish,
  payload: dishName,
});

export const clearCart = () => ({
  type: CART_ACTIONS.clearCart,
});
